import React, { Component } from "react";

class NavigationBar extends Component {
  state = {};
  render() {
    return (
      <div className="navigation-bar">
        <button id="home" type="button" onClick="">
          Home
        </button>
        <button id="latest" type="button" onClick="">
          Latest
        </button>
        <button id="popular" type="button" onClick="">
          Popular
        </button>
        <button id="trending" type="button" onClick="">
          Trending
        </button>
        <button id="deals" type="button" onClick="">
          Deals
        </button>
        <div className="acc-dropdown">
          <button id="account-dropdown">Account</button>
          <a href="#">1</a>
          <a href="#">2</a>
          <a href="#">3</a>
          <a href="#">4</a>
        </div>
      </div>
    );
  }
}

export default NavigationBar;
